import React from 'react'
import './ShowVideo.css'

function ShowVideo({vid}) {
    return (
        <>
            <div>
                <video src={`${vid?.video_src}`} className='video_ShowVideo'></video>
            </div>
        </>
    )
}

export default ShowVideo
